import { useContext, useState } from "react";
import { TranslationProvider } from "~/services/context";
import Button from "~/styles/component/buttons.module.scss";
import Styles from "./offline.module.scss";
import { useRouter } from "next/router";

const image =
  "data:image/png;base64, ";

export default function Offline() {
  const translation = useContext(TranslationProvider);

  const [loading, setLoading] = useState(false);

  // const router = useRouter();

  return (
    <div className={`text-center ${Styles.center}`}>
      <img src={image} alt="offline picture" />

      <h3>{translation("Offline Mode")} !</h3>
      <div className="mt-3">{translation("internet connection error")}</div>
      <button
        disabled={loading}
        onClick={() => {
          setLoading(true);
          setTimeout(() => {
            setLoading(false);
          }, 1500);
        }}
        className={`${Button.btnPrimary} ${Styles.button} ${
          loading ? Button.loading : ""
        }`}
      >
        {translation("retry")}
      </button>
    </div>
  );
}
